    [],nt"num_tags": 7,nt"name": "sand-lake-national-wildlife-refuge-annual-narrative-report-calendar-year-1990",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Sand Lake
    NWR, Pocasse NWR, and Sand Lake WMD outlines Refuge accomplishments during the 1990
    calendar year. The report begins with a summary of the year's highlights and weather
    conditions. Land acquisition is covered. The report includes a planning section
    which discusses management planning, public participation, compliance with environmental
    and cultural resource mandates, and research and investigations. Refuge administration
    is outlined; information about personnel, manpower programs, funding, safety, and
    technical assistance is given. Habitat management is also covered; subjects include
    wetlands, forests, croplands, grasslands, grazing, haying, fire management, pest
    control, water rights, and WPA easements. The wildlife section of the report discusses
    wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
    waterbirds, shorebirds, raptors, game mammals, fisheries resources, wildlife propagation,
    scientific collections, animal control, marking and bird banding, and disease control.
    The public uses of the Refuge described in this report include outdoor classrooms,
    interpretive programs, hunting, fishing, trapping, wildlife observation, outdoor
    recreation, and law enforcement. The equipment and facilities section of the report
    provides information about new construction, rehabilitation, major maintenance,
    equipment replacement, communication systems, computer systems, and energy conservation.
    Cooperative programs and items of interest are provided at the end.",nt"owner_org":
